import './App.css'
import PhonesPage from './pages/Phones/PhonesPage';

import {Switch, Route} from 'react-router-dom'
import IndexPage from './pages/IndexPage/IndexPage';

function App() {
  return (
    <Switch>
      <Route path='/' exact render = { () => <IndexPage/> } />
    </Switch>
  )
}

export default App;
